
def getCountVector(s,start,end):
    count_vec = [0]*4
    for i in range(start,end+1):
        c = s[i]
        if(c=='A'):
            count_vec[0] += 1
        elif(c=='T'):
            count_vec[1] += 1
        elif(c=='G'):
            count_vec[2] += 1
        else:
            count_vec[3] += 1
    return count_vec

def updateVector(count_vec,trail,lead):
    if(lead=='A'):
        count_vec[0] += 1
    elif(lead=='T'):
        count_vec[1] += 1
    elif(lead=='G'):
        count_vec[2] += 1
    else:
        count_vec[3] += 1

    if(trail=='A'):
        count_vec[0] -= 1
    elif(trail=='T'):
        count_vec[1] -= 1
    elif(trail=='G'):
        count_vec[2] -= 1
    else:
        count_vec[3] -= 1
    
def checkElems(count_vec, threshold):
    if(count_vec[0]>threshold or count_vec[1]>threshold or count_vec[2]>threshold or count_vec[3]>threshold):
        return True
    return False


def bearFunc2(s):
    n = len(s)
    expected_per_char_len = int(n/4)
    char_count = getCountVector(s,0,n-1)
    diff_count = [i-expected_per_char_len for i in char_count]
    print(char_count)
    print(diff_count)
    start_window_len = sum (i for i in diff_count if i<0)
    start_window_len *= -1
    
    hasResult = False
    result = -1
    window_char_count = None
    outside_char_count = None
    for wl in range(start_window_len,n):
        for ws in range(0,n-wl+1):
            if not ws:
                window_char_count = getCountVector(s,ws,ws+wl-1)
            else:
                updateVector(window_char_count,s[ws-1],s[ws+wl-1])
            outside_char_count = [i-j for i,j in zip(char_count,window_char_count)]
            invalids = checkElems(outside_char_count,expected_per_char_len)
            if not invalids:
                hasResult = True
                result = wl
                break
        if hasResult:
            break
    
    return result

def bearFunc2Faster(s):
    n = len(s)
    expected_per_char_len = int(n/4)
    char_count = getCountVector(s,0,n-1)
    right_lim = -1
    left_lim = 0
    window_char_count = [0]*4
    outside_char_count = None
    min_window_size = 99999 
    finished = False
    #First find the first bound for the right_lim (0 right_lim)
    for ws in range(1,n):
        if left_lim+ws-1>=n:
            break
        lead = s[left_lim+ws-1]
        if(lead=='A'):
            window_char_count[0] += 1
        elif(lead=='T'):
            window_char_count[1] += 1
        elif(lead=='G'):
            window_char_count[2] += 1
        else:
            window_char_count[3] += 1
        outside_char_count = [i-j for i,j in zip(char_count,window_char_count)]
        invalids = checkElems(outside_char_count,expected_per_char_len)
        if not invalids:
            right_lim = left_lim+ws-1
            cur_window_size = ws
            if(cur_window_size<min_window_size):
                min_window_size = cur_window_size
            break
    #print('Initial Limits:' + str(left_lim) + ',' + str(right_lim) + ':' + str(right_lim-left_lim+1)) 
    while right_lim<n:
        # Now lets try to increase the left lim as much as possible
        while left_lim<=right_lim:
            left_lim += 1
            lead = s[left_lim-1]
            if(lead=='A'):
                window_char_count[0] -= 1
            elif(lead=='T'):
                window_char_count[1] -= 1
            elif(lead=='G'):
                window_char_count[2] -= 1
            else:
                window_char_count[3] -= 1
            outside_char_count = [i-j for i,j in zip(char_count,window_char_count)]
            invalids = checkElems(outside_char_count,expected_per_char_len)
            if invalids:
                left_lim -= 1
                #restore the window count
                lead = s[left_lim]
                if(lead=='A'):
                    window_char_count[0] += 1
                elif(lead=='T'):
                    window_char_count[1] += 1
                elif(lead=='G'):
                    window_char_count[2] += 1
                else:
                    window_char_count[3] += 1
                break
            else:
                cur_window_size = right_lim-left_lim+1
                #print(cur_window_size)
                if(cur_window_size<min_window_size):
                    min_window_size = cur_window_size   
        #print('Left Limit Adj:' + str(left_lim) + ',' + str(right_lim) + ':' + str(right_lim-left_lim+1)) 
        #Now we will increment the right limit
        right_lim += 1
        if(right_lim<n):
            lead = s[right_lim]
            if(lead=='A'):
                window_char_count[0] += 1
            elif(lead=='T'):
                window_char_count[1] += 1
            elif(lead=='G'):
                window_char_count[2] += 1
            else:
                window_char_count[3] += 1
    return min_window_size
